import React from 'react';
import Modal from 'react-bootstrap/Modal';
import { Button } from 'react-bootstrap';

function Login() {
	return (
		<div>
			<Button> Open Modal</Button>
			<Modal show={false}></Modal>
		</div>
	);
}

export default Login;
